import sqlite3

# 连接到SQLite数据库（如果数据库文件不存在，会自动创建）
conn = sqlite3.connect('sale_data.db')  # 'example.db' 是数据库文件名
cursor = conn.cursor()  # 创建一个游标对象

# 创建表
cursor.execute('''
CREATE TABLE IF NOT EXISTS `ms_product` (
  `KD_OBAT` varchar(20)  NOT NULL,
  `NAMA` varchar(50)  NOT NULL,
  `SAT_JUAL` varchar(10)  NOT NULL,
  `KD_PABRIK` varchar(10)  NOT NULL,
  `HJ_RP` double NOT NULL,
  PRIMARY KEY (`KD_OBAT`)
)
''')
print("Table created successfully.")

